INSERT INTO `sys_parameter` VALUES ('2f0ac52a44d84367aa0b996dcdeaf504', 'aboutPrep', '关于', '<p>&nbsp;【The core of the Vpay】: Based on block chain distributed smart contract technology, realize the decentralization&nbsp;of currency, point to point circulate without loss and without trace. Let circulation generate&nbsp;value, let the quick flow increase the hash count. Explanation of nouns;&nbsp;</p><p>&nbsp;【Balance】: Legal tender cash, It\'s also called a cash coin or money for short.&nbsp;</p><p>&nbsp;【Credit】: The balance is in circulation once(to be transferred or paid), the system will give away 100% of the credit to the payer, which is the value of the balance circulation.&nbsp;</p><p>&nbsp;【Transfer-out】: Balance circulate between two accounts or multiple accounts.&nbsp;</p><p>&nbsp;【Transfer-in】: Collection(Generating the collection QR code).&nbsp;</p><p>&nbsp;【Purchase】: Online register for purchase balance.&nbsp;</p><p>&nbsp;【Sell】: Online register for sell balance.&nbsp;</p><p>&nbsp;【Vapy asset】: Based on block chain technology, the OPEN COIN open source algorithm development of digital encryption currency, the Ripple that Google invested in also is a digital cryptographic currency using this algorithm. Vpay asset has a total circulation of 365 million, Starting in 10 million, the remaining 355 million are excavated by means of increased circulation by the holder of the Vpay.&nbsp;</p><p>&nbsp;【Sharing】: Share links or QR codes and promote the app to more users. By sharing, if the shared account uses the app for transactions, it’s will facilitate the credit release of the sharers. Service Regulation; &nbsp;【Transfer-out Rules】: Making transfer or scan QR code to pay, the transferred balance amount by the transfer will be received in cash offline and will get a 100% credit at the same time. The receiver shall pay the equivalent cash to the transfer, the receiver receives an 80% balance and 20% credit. If the transfer is the first time transfer to the receiver, the system gives a 20% more credit to the receiver. For example, account A transfer to account B 10000 balance, so account B pay $10000 in cash to the A, account A get $10000 in cash and 10000 credit and get the balance of 8000 B and 2000 points, such as A is the first time transfer to B, then B and get 2000 points.&nbsp;</p><p>&nbsp;【Collection Rules】: It\'s the same as the Transfer-out Rules.&nbsp;</p><p>&nbsp;【Buy Rules】 : In order to ensure the integrity of online transaction, a deposit of 100 will be deducted for creating a top-up order. After the transaction is completed, the deposit will be automatically returned to the account.&nbsp;</p><p>&nbsp;【Sell Rules】 : It’s free and unlimited, with 85% of the cash after selling, the system no longer gives away score.&nbsp;</p><p>&nbsp;【Accelerate The Release Rules】: score of users according to the rate of 2 ‰ each day release to balance, In the case of users constantly sharing other users using the app, other users transfer flow limit and speed can be accelerated its score release speed, user score release speed will be likely to be 10%, 20%, 50%, or 100%. &nbsp;&nbsp;</p><p>&nbsp;【Rules Of Membership Grade】 : Free registration, register as a regular user, for ordinary users to share the app with friend and registered successfully, it’s can accelerate the score release, when a regular user score full 1 million points, the account will automatic upgrade \"VlP Member\".&nbsp;</p><p>&nbsp;【VIP Member】: Enjoy 8% of the following 15 layers of membership transact balance to be added to the account.</p><p><br></p>', '2018-04-24 15:47:25', '2018-04-24 15:47:25', '', '10', '关于');
