INSERT INTO `sys_parameter` VALUES ('424a804ce964494ca9776e533ff2b061', 'activeNoLimit', '激活次数限制', '0', '2018-03-16 14:48:27', '2018-05-18 10:54:23', '激活次数限制', '10', '激活');
INSERT INTO `sys_parameter` VALUES ('424c00998d7c452c9a6c41978920c076', 'aboutPrep_zh_en', '关于', '【Vpay的核心】：基于区块链分布式智能合约技术，实现货币的去中心化、点对点无损无痕流通，让流通产生价值，让快速流通增加哈希算力，最终加速价值的释放。<h5>名词释意：</h5>【余额】：法定货币现金，也可以称之为现金币，简称钱。<br/>【积分】：余额每流通（转出、支付）一次，Vpay系统会赠送80%的积分，积分是余额流通产生的价值。<br/>【转出】：余额在两个账户或者多个账户之间的流通<br/>【转入】：收款（生成二维码）<br/>【买入】：在线挂单求购余额<br/>【卖出】：在线挂单出售余额<br/>【Vpay资产】：基于区块链技术，OPEN COIN开源算法开发的数字加密货币，运用此算法的数字加密货币还有谷歌公司投资的瑞波币。Vpay资产总发行量3.65亿，首发1000万，剩余3.55亿由Vpay钱包用户通过流通增加算力挖取。<br/>【分享】：分享链接或二维码，推广给其他用户使用。通过分享，被分享者在使用Vpay的过程能加速分享者的积分释放速度。使用规则；<br/>【转出规则】：通过“转账”或“扫码支付”，转账方转出多少余额就收多少余额就收多少现金，同时获得80%的积分，收款方需支付相应的现金给转账方，收款方获得转账额80%余额和20%的积分。如：A转账给B→10000余额，那么B支付10000的现金给A，A得到10000的现金和8000的积分，B得到8000余额和2000的积分。<br/>【收款规则】：同上<br/>【买入规则】：为确保线上交易诚信，创建充值订单需扣除100的保证金，交易完成后，保证金自动退还账户。<br/>【卖出规则】：自由，无限制，挂单卖出后得到85%的现金，系统不在赠送积分。<br/>【加速释放规则】：用户积分按2‰的速度释放积分到余额，在用户不断分享其他用户使用Vpay钱包的情况下，其他用户的转账流通额度和速度可加速其积分释放速度，用户积分释放的速度将有可能是10%、20%、50%、100%。<br/>【会员级别规则】：用户免费注册，注册成功为普通用户，分享用户后可加速积分释放，当普通用户积分账户满100万时，自动升级“VIP会员”<br/>【VIP会员】：享受15代余额流通的8%加入到积分账户。', '2018-04-24 15:46:00', '2018-04-24 15:46:00', '', '10', '关于');
